        string[] city_intro = new string[8];
        city_intro[0] = "深圳港位于珠江口以东，南海大亚湾以西的深圳市两翼。深圳市的海岸线被香港九龙半岛分成东西两部分，因而深圳港分为西部港区和东部港区。 西部港区位于珠江口东岸入海前缘，主要包括蛇口、赤湾、妈湾和东角头和福永等港区；东部港区位于南海大鹏湾西北部，主要包括盐田和沙渔涌、下洞等港区。此外还有内和码头。东西港区均与香港九龙半岛隔海相望。 西部港区水路距珠江口门约32海里、距香港和澳门20海里、距黄浦40海里；陆路到深圳市中心30公里；东部港区水路至香港53海里、澳门75海里、黄浦121海里、距西部港区77海里；陆路至深圳市中心22公里。 深圳是我国南方对内对外的交通枢纽。铁路有京九线、广深线接京广线与全国铁路联通；我国第一条广深准高速铁路于1994年建成。公路有广深、深汕高速公路通往广州、惠州、汕头；深圳南有文锦渡、罗湖、沙头角和皇岗路口岸直通香港；盐田至惠州的一级汽车专用公路于1993年建成。 深圳国际机场距西部港区仅22公里，海空联运极为便利 ";
        city_intro[1] = "优越的地理位置和便利的集疏运交通，为上海港发展提供了良好的条件。上海港地处长江三角洲沿海与长江交汇处。以上海港为中心，北起连云港、南至温州港，西溯南京港，已形成了规模大、功能全、辐射广的长江三角洲港口群，在我国东部经济发展中，具有重要的战略意义。 从广义上看，上海港及其相邻港口的吸引范围广及整个长江流域及陇海、浙赣铁路沿线地区，这是长江三角洲港口群共有的腹地，对上海港来说，可谓第一层次的腹地。从狭义上分，江苏、浙江、安徽和江西四省是上海港及其相邻港口交叉的腹地，对上海港来说，可谓第二层次的腹地。 上海港第三层次的腹地，也是直接的腹地，就是上海市";
        city_intro[2] = "青岛港具有良好的运输条件。胶济铁路和胶黄铁路、济青高速公路、烟青高速公路、环胶州湾高速公路与港区相连。青岛港客运站与青岛国际航空港、青岛火车站连成立体交通服务网络。发达的铁路、公路、水路、管道运输，使青岛港具有高效的疏港运输能力。海路可达国内外各港口，货运航线可至东北、华北、华东各省沿海；客运有至上海、日本下关、韩国仁川等航线";
        city_intro[3] = "天津港位于渤海湾上的海河入海口，处于京津城市带和环渤海经济圈的交汇点上，是环渤海港口中与华北、西北等内陆地区距离最短的港口，是首都北京和天津市的海上门户，也是亚欧大陆桥的东端起点。天津港是中国最大的人工海港，是我国对外贸易的重要口岸现有水陆域面积近260平方公里，陆域面积72平方公里，规划到2010年港口陆域总面积达100平方公里。目前天津港航道最大可进出30万吨级船舶，水深最深达-19.5米。天津港主要分为北疆、南疆、东疆、海河四大港区";
        city_intro[4] = "宁波港水陆交通便捷，集疏运条件优越。宁波、镇海、北仑三个港区均有专用铁路通入，并纳入了国家铁路网。宁波港区后方即为铁路宁波货运北站，货物可通过北站进出港区；镇海港区设有铁路专用线通至码头前沿；北仑港区铁路是肖甬线的延伸，由北仑站接到码头前沿。通入镇海港区的主要公路有两条，一条是宁镇公路，另一条往北经骆驼镇与杭甬329国道接通：北仑港区的进出港公路亦有两条，一条是宁波经育王寺至穿山的329国道通港区，另一条是港区经宁波市小港经济技术开发区，通过江南公路至宁波。宁波市建有栎社二级国际机场，民航直达班机有通往北京、上海、广州、武汉、南京、南昌、福州、厦门、兰州等16条航线，直航香港包机已通航一年多。海运从宁波可达国内沿海各大港口。现辟有至香港的客货班轮每月2班、集装箱定期班轮航线每月10班，至日本神户线每月3班和横滨线每月2班，至澳大利亚的定期集装箱班轮每月1班";
        city_intro[5] = "大连港是一个天然深水良港，也是我国最大的散粮、石油进出口及对外贸易的口岸。具备装卸贮存、中转换装、多式联运、运输代理、通讯信息和生活服务等6项功能，在东北港口群体中处于枢纽和主导的地位。大连港的水域范围，自大连湾南岸的黄白嘴灯塔起，经大三山岛、险礁灯桩至沙鱼嘴连线内的海域，其面积共346平方公里。 其中，大连湾水域186平方公里，大窑湾水域33平方公里，小窑湾水域17平方公里，湾外水域110平方公里，港区自然岸线长度为145公里。大连港陆域面积共8.4平方公里";
        city_intro[6] = "广州港濒临南海，毗邻香港、澳门，和深圳、珠海经济特区相邻，部分港区座落或分布在广州经济技术开发区范围内，属广东省广州市辖境。既是华南地区最大的国际贸易港，又是珠江三角洲水网运输中心和水陆运输枢纽。港口交通便利，铁路有京广、广九、广湛线与全国主干铁路相连，形成铁路运输网；公路与汕头、湛江、深圳等省内重要市县均有干线连通，公路网络沟通闽、赣、湘、桂等省区。广州白云国际机场已开辟国内、国际航线30条左右，来往于全国主要大中城市及香港、曼谷、马尼拉、新加坡、悉尼、墨尔本、吉隆坡等地的航班，可完成各货航空运输。 广州港北距汕头276海里，南距香港70海里，西距湛江273海里。经虎门出海可达沿海各港及世界100多个国家（地区）的600多个港口。至海口、厦门、上海、青岛、大连等港有定期客货班轮，至香港间有飞翔班轮。内河可至珠江水系的东江、西江、北江各港";
        city_intro[7] = "厦门港交通发达，已形成陆海空立体交通体系。铁路运输有鹰(潭)厦(门)铁路为干线，省内与外(洋)福(州)线、漳(平)龙(岩)线、漳(平)泉(州)线等铁路支线连接。厦门的公路通过高集海堤和厦门大桥与全省公路连网，形成了以福(州)厦(门)、厦(门)漳(州)主干道为骨干的运输网。厦门的高崎国际机场已拥有国内外航线31条。水运航线可通我国沿海、长江中下游和世界各港，内河可通九龙江干支流和乡镇码头。沿海航线北距上海561海里、福州201海里；东距台湾省基隆222海里、高雄165海里、台中130海里、澎湖102海里；南至广州389海里、香港287海里。客运有通过香港、上海、广州、温州、海口、汕头等航线";


